&quot;Its celebration time with Hi5 and you&amp;#039;re invited to join in all the excitement! From birthdays, to Christmas and even Carnivale, theres so much to enjoy. So put on your party clothes and slip on your dancing shoes lets celebrate the Hi5 way!  For Chatterbox&amp;#039; fifth birthday, Hi5 has planned some special surprises. A fairy, a magician, even a firefighter are invited to the party. With her favourite cake to share and a secret present arriving, this will be Chats best birthday ever! &quot;
